package com.mycompany.tutorial.ch03;

public class CompareOperatorExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		String v1 = "ABC";
		String v2 = "DEFG";
		int iv1 = 12;
		int iv2 = 24;
		
		System.out.println(v1 == v2);
		System.out.println(iv1 < iv2);
		System.out.println(iv1 != iv2);
		System.out.println(iv1 <= iv2);
		System.out.println(iv1 >= iv2);
		
	}

}
